import { Component, NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { AdmindashComponent } from './admindash/admindash.component';
import { AppointmentComponent } from './appointment/appointment.component';
import { CreateAppointmentComponent } from './create-appointment/create-appointment.component';
import { HomeComponent } from './home/home.component';
import { DoacdashComponent } from './doacdash/doacdash.component';
import { CreatePatientComponent } from './create-patient/create-patient.component';
import { MedicinelistComponent } from './medicinelist/medicinelist.component';
import { CreateMedicineComponent } from './create-medicine/create-medicine.component';
import { UpdatePatientComponent } from './update-patient/update-patient.component';
import { ViewPatientComponent } from './view-patient/view-patient.component';
import { UpdateMedicineComponent } from './update-medicine/update-medicine.component';
import { ViewMedicineComponent } from './view-medicine/view-medicine.component';
import { DocloginComponent } from './doc-login/doc-login.component';
import { AdLoginComponent } from './ad-login/ad-login.component';
import { AdminauthguardService } from './adminauthguard.service';
import { DoctorauthguardService } from './doctorauthguard.service';

const routes: Routes = [
  {
    path:'admin' , component:AdmindashComponent,canActivate: [AdminauthguardService]
  },
  {
    path:'appointmentlist',component:AppointmentComponent,
    canActivate: [AdminauthguardService]
  },

  {
  path:'create-appointment',component:CreateAppointmentComponent,
  canActivate: [AdminauthguardService]
},
{
  path:'home' ,component:HomeComponent
},
{
  path:'docdash',component:DoacdashComponent,
  /canActivate: [DoctorauthguardService]
},
{path:'create-patient',component:CreatePatientComponent
},
{
  path:'medicinelist',component:MedicinelistComponent
},
{
  path:'create-medicine',component:CreateMedicineComponent
},
{
  path:'update-patient/:id',component:UpdatePatientComponent
},
{
  path:'view-patient/:id',component:ViewPatientComponent
},
{
  path:'update-medicine/:id',component:UpdateMedicineComponent
},
{
  path:'view-medicine',component:ViewMedicineComponent

},
{
path:'doc-login',component:DocloginComponent
},
{
  path:'ad-login',component:AdLoginComponent
},
{
  path:'',redirectTo:'home',pathMatch:'full'
},

];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
